@WillAyd I don't believe that case is being hit here - the issue is that the multicolumn case aggregates for columns `value1`, `value2`, `value3`, which are all numeric (and thus fast due to cython path). The single column case also includes the column `key2`, which is a `str` column and thus must use the slower pure python path.

These factors lead to the misleading output of the single col case being 6x slower than the multicol case.

@jreback The typo was fixed in master, but there's an issue in the benchmark definition still.
